import React from 'react';
import './LeftNav.css';

const leftNav = ({ open }) => {
  return (
    <ul className={`left-nav ${open ? 'open' : ''}`}>
      <li>Home</li>
      <li>About Us</li>
      <li>Contact Us</li>
      <li>Sign In</li>
      <li>Sign Up</li>
    </ul>
  );
};

export default leftNav;
